import './App.css';

import ShowSearch from './components/search';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <showSearch></showSearch>
    </div>
  );
}

export default App;
